INSERT INTO `news` (`newsid`, `type`, `title`, `abstract`, `content`, `main`, `thumb`, `internal`, `date`) VALUES
(1, 1, 'Fundação do SINDOJUS-AC', 'Em 8 de dezembro de 2017, reunidos em Assembleia Geral, os oficiais de Justiça do Acre fundaram o Sindojus-AC (Sindicato dos Oficiais de Justiça do Acre). O objetivo é a representação sindical específica da categoria dos Oficiais de Justiça no Estado do Acre. A Assembleia também elegeu a diretoria e o conselho fiscal da primeira gestão da organização. O primeiro presidente eleito é o oficial de Justiça James Cley Nascimento Borges e para vice foi eleito o oficial de Justiça Cleido Rodrigues da Silva e Silva.', 'Em 8 de dezembro de 2017, reunidos em Assembleia Geral, os oficiais de Justiça do Acre fundaram o Sindojus-AC (Sindicato dos Oficiais de Justiça do Acre). O objetivo é a representação sindical específica da categoria dos Oficiais de Justiça no Estado do Acre. A Assembleia também elegeu a diretoria e o conselho fiscal da primeira gestão da organização. O primeiro presidente eleito é o oficial de Justiça James Cley Nascimento Borges e para vice foi eleito o oficial de Justiça Cleido Rodrigues da Silva e Silva.', 'assets/img/slides/nivo/bg-1.jpg', 'assets/img/slides/nivo/bg-1.jpg', 'assets/img/slides/nivo/bg-1.jpg', '2018-08-29 21:39:33'),
(2, 1, 'SINDOJUS-AC presente na visita da FOJEBRA à PF', 'Representantes do SINDOJUS-AC estiveram juntos com dirigentes da FOJEBRA em reunião com a Dra. Silvana Borges, Diretora Executiva do DIREX, órgão auxiliar da Polícia Federal, e com o Dr. Tony Gean de Castro, Chefe da Divisão Nacional de Armas (DARM). \r\nO presidente da FOJEBRA, Edvaldo Lima, abriu a reunião apresentando a Federação, seus estados componentes, e fazendo um breve histórico do tema “Porte de Arma para os Oficiais de Justiça”.', 'Os dirigentes da FOJEBRA estiveram em reunião na terça-feira (13/03), na parte da tarde, com a Dra. Silvana Borges, Diretora Executiva do DIREX, órgão auxiliar da Polícia Federal, e com o Dr. Tony Gean de Castro, Chefe da Divisão Nacional de Armas (DARM).\r\n\r\nO presidente da FOJEBRA, Edvaldo Lima, abriu a reunião apresentando a Federação, seus estados componentes, e fazendo um breve histórico do tema “Porte de Arma para os Oficiais de Justiça”.\r\n\r\nOficiais de Justiça de 14 estados do Brasil estiveram presentes e expuseram as dificuldades específicas encontradas em suas regiões no cumprimento das ordens judicias. Os diretores da Polícia Federal afirmaram que a instituição está ciente dessas dificuldades e salientaram que medidas já estão sendo adotadas pelo órgão, inclusive o Direx já enviou ofício às superintendências regionais tratando do assunto.\r\n\r\nSegundo a Dra. Silvana, a atividade dos Oficiais de Justiça “é uma das tarefas mais difíceis do Poder Judiciário e entendo que o pedido é justo pela natureza do trabalho que eu conheço muito bem”. A  delegada acrescentou também que o Diretor Geral da PF, Dr. Rogério Augusto Viana Galloro, também é sensível ao pedido da categoria.\r\n\r\nJá o Chefe da Divisão Nacional de Armas, Dr. Tony, elogiou o dossiê elaborado pela Federação sobre crimes cometidos contra Oficiais de Justiça e afirmou que o PLC 30/2007 ainda é o melhor caminho para a conquista do pleito pela categoria, porque a Polícia Federal não pode suprir o papel do legislador, mas fez o que estava ao alcance da instituição lançando o Ofício Circular 05/2017 através da DIREX.\r\n\r\nFoi discutida, ainda, a possibilidade de alteração na Instrução Normativa 23/2005, com o intuito de deixar o texto mais favorável a essa pretensão dos Oficiais de Justiça, o que acabou parecendo a todos uma boa solução.\r\n\r\nAproveitando o gancho, o Diretor de Assuntos Legislativos da FOJEBRA, Joselito Bandeira Vicente, ressaltou o alto índice de violência contra Oficiais de Justiça no Brasil. “Desde o Estatuto do Desarmamento, tivemos 31 Oficiais mortos, um número superior até às mortes de Policiais Federais, que foram 10”, disse o dirigente.\r\n\r\nDemais presidentes de entidades fizeram suas colocações complementando as falas e enriquecendo o debate.\r\n\r\nNa oportunidade, o Presidente da FOJEBRA, Edvaldo Lima, agradeceu a receptividade, o empenho da PF, e se prontificou a ajudar no que for preciso.', 'assets/img/slides/nivo/bg-2.jpg', 'assets/img/slides/nivo/bg-2.jpg', 'assets/img/slides/nivo/bg-2.jpg', '2018-08-29 21:39:43'),
(3, 1, 'SINDOJUS-AC presente em assembléia da FOJEBRA em Brasília', 'Diretores das entidades sindicais de norte a sul do país, estiveram reunidos na sede da Fojebra em Brasília, para realização da assembleia extraordinária convocada para data do dia 09 de julho. Diversos pontos foram deliberados, inclusive medidas eficácias contra entidades sindicais que tentar inibir o trabalho realizado pela Fojebra, inclusive por questões políticas.', 'Diretores das entidades sindicais de norte a sul do país, estiveram reunidos na sede da Fojebra em Brasília, para realização da assembleia extraordinária convocada para data do dia 09 de julho. Diversos pontos foram deliberados, inclusive medidas eficácias contra entidades sindicais que tentar inibir o trabalho realizado pela Fojebra, inclusive por questões políticas. Tal postura anti sindicais vem atrapalhando o desenvolvimento dos Oficiais de Justiça no Brasil e no Estado referente a essas entidades. É preciso que os Oficiais de Justiça de alguns Estados da Federação acompanhem o que seus diretores andam fazendo, explicou Edvaldo Lima. A pedido de um dos coordenadores do “Conojus”, foi colocado em votação a participação dos membros da Fojebra no referido Congresso que acontecerá na cidade do Espírito Santo, por unanimidade os 16 Estados votaram pela não participação no evento. A Fojebra ratifica seus compromissos com a ética e moral e dentro dos seus quadros de filiados só aceitará entidades que de fato tenham compromisso com a categoria dos Oficias de Justiça e que zele pelo bom nome da justiça. Por fim, foi apresentado a todos os participantes o novo aplicativo, desenvolvido pelo Sindojus-AL que auxiliará o Oficial de Justiça na resolução dos conflitos. O presidente da Federação agradeceu a confiança e participação de todos presentes.\r\n\r\n', 'assets/img/slides/nivo/bg-3.jpg', 'assets/img/slides/nivo/bg-3.jpg', 'assets/img/slides/nivo/bg-3.jpg', '2018-08-29 21:39:51');
